import React from 'react';
import Slide from './Slide';

const ClosingSlide = () => (
  <Slide className="closing-slide">
    <h2>Thank You for Your Attention!</h2>
    <p>Questions? Feel free to ask!</p>
  </Slide>
);

export default ClosingSlide;
